social_posts.post_text:
“You know what they say….. if young Metro don’t trust ya”…. And I’m so glad you did bro 🙏🏾✊🏾. Also thankful that @charmladonna @karonlynntv and @tanya_karn did as well.  This was yet another on for the books. 

 @metroboomin you are talented and that’s a given but the human you are and the desire to inspire and elevate that you have is nothing short of divine.  Thanks for being a voice and source of strength for the many of us that have gone through hell and choose to rise from the ashes.  Grateful for this whole experience and you. 

To all the bros I got the opportunity to share the stage with; I’m am truly grateful for you all and hope to grow with y’all more.  Until next time fam✊🏾✊🏾✊🏾✊🏾✊🏾💎💎💎💎

The Celebration Tour ‘23 with THE ONE AND ONLY @madonna 🙌🏾. I’m so grateful to have contributed choreography and movement direction on this project.  In my opinion,  it was a small contribution amongst the many genius creatives that created this Modern Nostalgic Masterpiece of a tour, STILL O’ what a blessing to be in the room. 

@majnoonaaaaa none of this would’ve been possible without you point blank period.  Thankful for you always.

@tajariley Thank you slay for ushering me in on this 🙏🏾.

@caddyisbright I truly would have been LOST without you.  It’s not only your incredible choreographic skills but also your ability to take any curveball while dealing with incredibly vast personalities yet still creating the most positive environment you possibly can.  What a leader 💎 

@la.horde oh to work with such amazing spirits 🫶🏾💎 

@damienjalet Thank you for sharing your wisdom and also allowing me to witness and experience your craft. 

To ALL of the incredible dancers thank you so much for allowing me to create with you and also for me to learn and observe true Teamwork and Spirit.  I’ve never witness a group of dance artists work as hard and diligently as you guys while keeping a true spirit of family. 

